import React, { Fragment } from "react";
import { Link } from "react-router-dom";

class Navbar extends React.Component{
    constructor(props){
        super(props)
    }

    render(){
        return(
            <Fragment>
                <nav className="navbar navbar-dark bg-successnavbar-expand-sm">
                    <div className="container">
                        <Link to='/' className="navbar-brand color-dark">BigBasket</Link>
                    </div>
                </nav>
            </Fragment>
        )
    }
}

export default Navbar
